    chart: {
        type: 'spline',
        backgroundColor:"#F9F9F9",
      },
    title: {
      text: ''
    },
    xAxis: {
        type: 'datetime',
        tickInterval: 1000 * 3600 * 24 *30 // 1 month
    },
    series: [{
        name: 'Alerts',
