            {x: Date.UTC(2014,10,1), y: 11},
            {x: Date.UTC(2014,11,1), y: 12},
            {x: Date.UTC(2015,0,1), y: 1},
            {x: Date.UTC(2015,1,1), y: 2},
            {x: Date.UTC(2015,2,1), y: 3},
            {x: Date.UTC(2015,3,1), y: 4},
            {x: Date.UTC(2015,4,1), y: 5}],
        color:'green',

        dataLabels: {
            enabled: false,
            
            color: '#FFFFFF',
            align: 'right',
            x: -60,
            y: 20,
            style: {
                fontSize: '13px',
                fontFamily: 'Verdana, sans-serif'
            }
        }
    },
    {
        name: 'Risk',
        data: [8.25,9.75,4.5,4.5,5.25,9,3,13.5,15.75,27.75,12,19.5,12,18.75,16.5,1.5,12,4.5,3,9,3.75,4.5,9,3.75 ],
        color:'red',
        dataLabels: {
            enabled: false,
            
            color: '#FFFFFF',
            align: 'right',
            x: -60,
            y: 20,
            style: {
                fontSize: '13px',
                fontFamily: 'Verdana, sans-serif'
            }
        }
    }

]

  }
class LineChart1 extends React.Component{
    constructor(){
        super()
    }
render(){
    return(
        <div>
    <HighchartsReact
      highcharts={Highcharts}
      options={options}
    />

        </div>
    )
}
}
export default LineChart1;
